import React, { useState } from 'react';

const OrderOnlinePage = () => {
    const [items, setItems] = useState([
        { name: 'Fried Calamari (🌶️)', category: 'Starters', price: 10, quantity: 0 },
        { name: 'Cheesy Bites (🌶️)', category: 'Starters', price: 5, quantity: 0 },
        { name: 'Tuna and crab cakes (🌶️🌶️)', category: 'Starters', price: 10, quantity: 0 },
        { name: 'Gâteau piment (🌶️🌶️|🍃)', category: 'Starters', price: 5, quantity: 0 },
        { name: 'Fish ball and seafood soup (🌶️🌶️🌶️)', category: 'Starters', price: 10, quantity: 0 },
        { name: 'vegetable dumplings soup (🌶️|🍃)', category: 'Starters', price: 5, quantity: 0 },
        { name: 'vegetable dumplings siiioup (🌶️|🍃)', category: 'Starters', price: 5, quantity: 0 },
        { name: 'Farata and choice of 2 curries (🌶️|🍃)', category: 'Platters', price: 15, quantity: 0 },
        { name: 'La daube poulet (🌶️🌶️)', category: 'Platters', price: 15, quantity: 0 },
        { name: 'Fish masala curry (🌶️🌶️🌶️)', category: 'Platters', price: 15, quantity: 0 },
        { name: 'Octopus stew (🌶️)', category: 'Platters', price: 15, quantity: 0 },
        { name: 'Shrimp curry (🌶️🌶️)', category: 'Platters', price: 15, quantity: 0 },
        { name: '7 curries platter (🌶️|🍃)', category: 'Platters', price: 15, quantity: 0 },
        { name: 'Mine frite (🌶️)', category: 'Mains', price: 10, quantity: 0 },
        { name: 'Riz frite (🌶️)', category: 'Mains', price: 8, quantity: 0 },
        { name: 'Haalim with bread (🌶️🌶️🌶️|🍃)', category: 'Mains', price: 10, quantity: 0 },
        { name: 'Dhall puri with curry (🌶️|🍃)', category: 'Mains', price: 8, quantity: 0 },
        { name: 'Vermicelli noodles (🌶️)', category: 'Mains', price: 10, quantity: 0 },
        { name: 'Pain kebab (🌶️🌶️)', category: 'Mains', price: 8, quantity: 0 },
        { name: 'Panakon', category: 'Drinks', price: 3, quantity: 0 },
        { name: 'Lemonade', category: 'Drinks', price: 4, quantity: 0 },
        { name: 'Coconut water', category: 'Drinks', price: 3, quantity: 0 },
        { name: 'Eski', category: 'Drinks', price: 4, quantity: 0 },
        { name: 'Pearona', category: 'Drinks', price: 3, quantity: 0 },
        { name: 'Fanta Passion', category: 'Drinks', price: 4, quantity: 0 },
    ]);

    const handleQuantityChange = (index, value) => {
        const updatedItems = [...items];
        updatedItems[index].quantity = value;
        setItems(updatedItems);
    };

    const calculateTotalPrice = () => {
        return items.reduce((total, item) => total + item.price * item.quantity, 0);
    };

    const handleConfirmAndPay = () => {
        //to be implemented later
    };

    const categories = [...new Set(items.map((item) => item.category))];

    return (
        <div className="order-online-page">
            <h1 className="order-online-title">Order Online</h1>
            <div className="order-online-box">
                {categories.map((category) => (
                    <div key={category}>
                        <h2>{category}</h2>
                        {items
                            .filter((item) => item.category === category)
                            .map((item, index) => (
                                <div key={index} className="order-item">
                                    <span>{item.name}</span>
                                    <span>${item.price}</span>
                                    <input
                                        type="number"
                                        value={item.quantity}
                                        min={0}
                                        onChange={(e) => handleQuantityChange(index, parseInt(e.target.value))}
                                    />
                                </div>
                            ))}
                    </div>
                ))}
                <div className="total-price">Total Price: ${calculateTotalPrice()}</div>
                <div className="payment-section">
                    <h2>Enter Payment Details</h2>
                    <input type="text" placeholder="Name" />
                    <input type="text" placeholder="Card Number" />
                    <input type="text" placeholder="CVC" />
                    <button className="confirm-pay-btn" onClick={handleConfirmAndPay}>
                        Confirm and Pay
                    </button>
                </div>
            </div>
        </div>
    );
};

export default OrderOnlinePage;
